E_D("replace into `phome_ecms_game` values('14223','19','0','','','','1','admin','','1','0','1346121614','0','0','0','0','','','14223','0','0','0','0','0','0','小红帽','1346121614','/spic/20120725/10951.jpg','0','1','1346121614','0','3','1','0','','0','','/d/file/swf/xiaohongmao1.swf','667','479','从前有个人见人爱的小姑娘，喜欢戴着祖母送给她的一顶红色天鹅绒的帽子，于是大家就叫她小红帽。有一天，母亲叫她给外婆送食物，并嘱咐她不要离开大路，走得太远。小红帽在森林中遇见了狼，她从未见过狼，也不知道狼性残忍，于是把来森林中的目的告诉了狼。狼知道后诱骗小红帽去采野花，自己跑到林中小屋去把小红帽的外婆吃了。并装成外婆，等小红帽来找外婆时，狼一口把她吃掉了。后来一个猎人把小红帽和外婆从狼肚里救了出来。 　　后来人们就用小红帽来比喻天真幼稚、容易上当受骗的孩子。','1','','0','','1','/dpic/20120725/10952.jpg','747','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5vY0ZsWE9XOWlNalZ1WWxkR2RrMVROWHBrTWxrOQ==','0','0','http://s.61baobao.com/common/flash/2006/xiaohongmao1.swf','http://www.61baobao.com/common/flash/2006/dpic/xiaohongmao1.jpg','http://www.61baobao.com/common/flash/2006/pic/747.jpg','0','三个月以上','0','','0','','0','0','0');");
