E_D("replace into `phome_ecms_game` values('14228','19','1','','','','1','admin','','1','0','1346121621','0','0','0','0','','','14228','0','0','0','0','0','0','三只小猪','1346121621','/spic/20120725/10965.gif','0','1','1346121621','0','7','2','0','','0','','/d/file/swf/7003.swf','667','479','猪妈妈有三个孩子，呼呼，噜噜和嘟嘟，有一天猪妈妈说：孩子们，你们都长大了，每个人出去盖一间房子，看看你们谁的本领大。呼呼想偷懒，找来几堆稻草，很快的建了一个草房子。噜噜也想偷懒捡来几根木棍，很快的建了一个木房子。只有嘟嘟好好建了一个结实的砖房子，忽忽和噜噜来找嘟嘟玩，嘟嘟不理他们继续建房子。有一天森林里来了一只大灰狼，他很久没吃东西了，饿的“嗷嗷”直叫。大灰狼看见呼呼的草房子，“呼”的一声草房子被吹散了。呼呼拔腿就跑到了噜噜的木房子，大灰狼追上来恶狠狠的说：“我要吃掉你们。”大灰狼又“呼”了一声，噜噜的木房子不一会儿也被大灰狼吹散了。忽忽何璐璐敲开了嘟嘟的房门，三只小猪都躲在了嘟嘟的砖房子里面，大灰狼追过来，用尽全身力气，“呼，呼”转房子一动也不动。大灰狼又气又累，他看见房顶有个烟囱，便想从上面爬进嘟嘟的房子里。聪明的嘟嘟早就在烟囱下面烧了一锅滚烫的开水，大灰狼正好掉进锅里烫的“嗷嗷”直叫，不一会儿就被烫死了，呼呼和噜噜很惭愧，决心以后一定要向嘟嘟学习，再也不偷懒了。','1','','0','','1','/dpic/20120725/10966.gif','748','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjNUVVJOZFdNelpHMD0=','1','0','http://s.61baobao.com/common/flash/d/7003.swf','http://www.61baobao.com/common/flash/d/dpic/7003.gif','http://www.61baobao.com/common/flash/d/pic/7003.gif','0','三个月以上','0','','0','','0','0','0');");
